  <!-- Funky style -->
  <style>
    body {
      background-color: #24a6e2;
    }

    .wrapper {
      height: 100vh;
      /*This part is important for centering*/
      display: grid;
      place-items: center;
    }

    @keyframes grow {
      0% {
        max-height: var(--lineHeight);
      }

      100% {
        max-height: calc(var(--lineHeight) * var(--lines));
      }
    }

    @keyframes carriageReturn {
      0% {
        top: 0;
      }

      100% {
        top: calc(var(--lineHeight) * var(--lines));
      }
    }

    @keyframes type {
      0% {
        width: 100%;
      }

      100% {
        width: 0%;
      }
    }

    @keyframes caret {
      0% {
        color: var(--bgColor);
      }

      100% {
        color: white;
      }
    }

    .typewriter {
      --bgColor: #24a6e2;
      --lines: 500;
      --lineHeight: 2rem;
      --timePerLine: 1.5s;
      --widthCh: 45;
      --width: calc(var(--widthCh) * 1ch);
      /* do not touch the time property!!! */
      --time: calc(var(--lines) * var(--timePerLine));
      animation: grow var(--time) steps(var(--lines));
      animation-fill-mode: forwards;
      background: var(--bgColor);
      line-height: var(--lineHeight);
      max-height: var(--lineHeight);
      overflow: hidden;
      position: relative;
      width: var(--width);
      color: white;
      /* word-break: break-all; */
    }

    .typewriter::before {
      content: "";
      animation:
        type var(--timePerLine) linear infinite,
        carriageReturn var(--time) steps(var(--lines)) var(--lines),
        caret 0.5s steps(2) infinite;
      background: var(--bgColor);
      border-left: 2px solid;
      bottom: 0;
      height: 2rem;
      position: absolute;
      right: 0;
      width: 100%;
    }

    .typewriter.no-caret::before {
      border-left-width: 0;
    }

    .typewriter.monospace {
      font-family: monospace, monospace;
      font-size: 1.5em;
    }

    .typewriter.monospace::before {
      animation:
        type var(--timePerLine) steps(var(--widthCh)) infinite,
        carriageReturn var(--time) steps(var(--lines)) var(--lines),
        caret 0.5s steps(2) infinite;
    }
  </style>
  <!-- \Funky style -->
